text:
fica no ar uma pergunta;
porque o Vasco não joga assim todos os jogos?
mas contra o nosso Flamengo fica a máxima: jogou como nunca, perdeu como sempre. kkkkkkkkkk

 @YuuFost  Vc tá meio preso em 2019... Eu já tô falando de 2020 pra cá. O próprio Gabi já disse e sabe que ele não tem cabeceio. Todo atacante precisa de armação, o problema não é esse. O problema é que Gabi não tem eficiência, pode pesquisar... O Gabi é o atacante mais ineficiente desse Brasileirão. É assim desde muito tempo, em 2019 ele já era assim também, porém ele recebia muitas chances e em uma delas convertia, o que fazia a torcida não pegar no pé dele.

Em questão ao Haaland, ele é um dos atacante mais rápido do mundo, tem muita força, um bom arranque, uma boa pontaria, um bom cabeceio e assim vai... Ele só não tem um bom drible, que é um dos ponto fracos dele. Gabi não tem isso... Nada disso que citei a favor do Haaland, além de também não ter bom drible (x1). 

Todos jogadores tiveram sua queda, mas a do Gabi foi por conta dele mesmo... Assim como outros jogadores também. Excessão de 2019 foi o Arrascaeta que manteve a mesma regularidade. O Everton Ribeiro tinha seus momentos, conseguiu fazer um bom ano de 2020/2022 sendo até convocado pra seleção brasileira.
